import React from 'react';
import axios from 'axios';
import Search from '.Search';
import componentDidMount from "react-transition-group/esm/SwitchTransition";

const Home = () => {
    state = {
        cats: []
    };

    componentDidMount()
    {
        const catsUrl = '${url}/cats/';
        axios.get(url).then(response => response.data)
            .then((data) => {
                this.setState({cats: data})
                console.log(this.state.cats)
            });

        return (
            <div>
             <Search />
            </div>
        );
    }
};


export default Home;
